import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file with domcontentloaded to avoid timeout
    await page.goto(fileUrl, { waitUntil: 'domcontentloaded' });

    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for search input and type to trigger autocomplete
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'iPhone');

    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_typing.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_typing.png'));

    // Wait for suggestions to appear using different selector strategies
    try {
      // Try waiting for suggestions container
      await page.waitForSelector('.search-suggestions', { timeout: 3000 });
    } catch {
      // If container not found, look for suggestion items directly
      await page.waitForSelector('.suggestion-item', { timeout: 3000 });
    }

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_suggestions_visible.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_suggestions_visible.png'));

    // Extract suggestion text content
    const suggestions = await page.$$eval('.suggestion-item', 
      items => items.map(item => item.textContent.trim())
    );

    return {
      success: true,
      action: "Tested search autocomplete by typing 'iPhone' and captured suggestions",
      extractedData: {
        searchTerm: 'iPhone',
        suggestionsCount: suggestions.length,
        suggestions: suggestions
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to test search autocomplete functionality",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
